import React, { useEffect, useState } from 'react';
import Button from 'react-bootstrap/Button';
import Navbar from '../navSection/Navbar';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import { Link, useNavigate } from 'react-router-dom';
import Footer from '../footerSection/Footer';
import axios from 'axios';

import { useDispatch, useSelector } from 'react-redux';
import { fetchSuccess } from '../redux/userSlice';

function SignUp() {
  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [firstName, setFirstName] = useState('');
  const [comfirmPassword, setComfirmPassword] = useState('');
  const [country, setCountry] = useState('');
  const [state, setState] = useState('');
  const [age, setAge] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { userInfo } = useSelector((state) => state.user);

  const handleSignUp = async (e) => {
    e.preventDefault();
    try {
      const { data } = await axios.post(
        `http://localhost:5000/api/users/signin`,
        {
          name: name,
          password: password,
        }
      );
      dispatch(fetchSuccess(data));
    } catch (error) {
      setError(error.response.data.message);
    }
  };

  useEffect(() => {
    if (userInfo?.user?.name) {
      navigate('/');
    }
  });

  return (
    <div>
      <Navbar />

      <div
        className="d-flex justify-content-center flex-column align-items-center"
        style={{ width: '100%', height: '70vh' }}
      >
        <Button
          variant="danger"
          className="bg-danger opacity-75 p-1"
          style={{ borderRadius: '50%' }}
        >
          key
        </Button>
        <strong>Sign In</strong>
        <Form onSubmit={handleSignUp}>
          <InputGroup className="my-3">
            <InputGroup.Text>name</InputGroup.Text>
            <Form.Control
              type="name"
              onChange={(e) => setName(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Surname</InputGroup.Text>
            <Form.Control
              type="name"
              onChange={(e) => setSurname(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>First-Name</InputGroup.Text>
            <Form.Control
              type="name"
              onChange={(e) => setFirstName(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>State</InputGroup.Text>
            <Form.Control
              type="name"
              onChange={(e) => setState(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Country</InputGroup.Text>
            <Form.Control
              type="name"
              onChange={(e) => setCountry(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Age</InputGroup.Text>
            <Form.Control
              type="Date"
              onChange={(e) => setAge(e.target.value)}
            />
          </InputGroup>
          <InputGroup>
            <InputGroup.Text>Password</InputGroup.Text>
            <Form.Control
              type="password"
              onChange={(e) => setPassword(e.target.value)}
            />
          </InputGroup>
          <InputGroup>
            <InputGroup.Text>Comfirm Password</InputGroup.Text>
            <Form.Control
              type="password"
              onChange={(e) => setComfirmPassword(e.target.value)}
            />
          </InputGroup>
          <div className="d-grid my-3">
            <Button variant="success" className="bg-success" type="submit">
              Login
            </Button>
          </div>
        </Form>
        <div>
          <strong>
            {' '}
            Have an account ? <Link to="/signin"> sign in here</Link>
          </strong>
        </div>
        {error !== null && <Error error={error} />}
      </div>
      <Footer />
    </div>
  );
}

export default SignUp;
